        [Fact]
        public void Test1()
        {
            var nums = new int[] {2,7,11,15 };
            var target = 9;
            var arr = new List<int>();
            for (var i = 0; i < nums.Length ;i++)
            {
                if (nums[i] > target)
                    continue;
                var firstNum = nums[i];
                var secondNum = target - firstNum;
                for (var j = i + 1; j< nums.Length;j++)
                {
                    if (nums[j] != secondNum)
                        continue;
                    arr.Add(j);
                    arr.Add(i);
                    Trace.WriteLine(JsonConvert.SerializeObject(arr.ToArray()));
                    return ;
                }
            }
        }

        [Fact]
