        public void NumIdenticalPairs(int[] nums)
        {
            var totalIdenticalPairs = 0;
            for (var  i = 0; i < nums.Length; i++)
            {
                for (var  j = i + 1; j < nums.Length; j++)
                {
                    if (nums[i] == nums[j])
                    {
                        totalIdenticalPairs++;
                    }
                }
            }
        }

        [Fact]
        public void NumSub()
        {
            var s = "";
            var arr = s.ToCharArray();
            var subStringLength = 0.0;
            for (var i = 0; i < arr.Length; i++)
            {
                var length = 0.0;
                if (arr[i] != '1')
                    continue;
                for (var j = i; j < arr.Length; j++)
                {
                    if (arr[i] != arr[j])
                        break;
                    length++;
                    i = j;
                }
                subStringLength += length * (length + 1) / 2;
                
            }

            subStringLength = subStringLength % (Math.Pow(10, 9) + 7);
            //return subStringLength;
        }

        [Fact]
        public void Intersect()
        {
            int[] nums1 = new []{ 1,2} ;
            int[] nums2 = new[] { 2,1 };
            var num1List = nums1.ToList();
            var num2List = nums2.ToList();
            var length1 = nums1.Length;
            var length2 = nums2.Length;
            var list = new List<int>();
            if (length1 > length2)
            {
                for (var i = 0; i < length2; i++)
                {
                    if (num1List.Contains(nums2[i]))
                    {
                        list.Add(nums2[i]);
                        var index = num1List.FindIndex(c => c == nums2[i]);
                        num1List.RemoveAt(index);
                    }
                }
            }

            else
            {
                for (var i = 0; i < length1; i++)
                {
                    if (num2List.Contains(nums1[i]))
                    {
                        list.Add(nums1[i]);
                        var index = num2List.FindIndex(c => c == nums1[i]);
                        num2List.RemoveAt(index);
                    }
                }
            }
        }

        [Fact]
        public void Intersect2()
        {
            int[] nums1 = new[] { 1, 2};
            int[] nums2 = new[] {2,1};
            Array.Sort(nums1);
            Array.Sort(nums2);
            var list = new List<int>();
            for (int i = 0,j=0; i < nums1.Length && j< nums2.Length;)
            {
                if (nums1[i] < nums2[j])
                    i++;
                else if (nums1[i] > nums2[j])
                    j++;
                else if (nums1[i] == nums2[j])
                {
                    list.Add(nums1[i]);
                    i++;
                    j++;
                }
            }
        }
